import { Col, Container, Row } from "react-bootstrap";
import Array from "./Array";

function Helper(){
    return(
        <Container>
            <Row>
                <Col sm = {12} md= {6}><Array/></Col>
            </Row>
        </Container>
    )
}

export default Helper
